import React from 'react';

const ScoreDisplay = ({ score, totalQuestions }) => {
    return (
        <div>
            <div className='relative flex flex-col text-center bg-[rgba(255,255,255,0.02)] z-0 h-[90vh] align-middle items-center'>
                <div className='align-middle items-center'>
                    <p className='text-4xl'>Votre score <br /><span className='text-4xl text-bold'>{score}</span> / {totalQuestions}</p>
                    <p>Vous avez un total de {score * 10} points</p>
                </div>
            </div>
        </div>
    );
}

export default ScoreDisplay;
